// 限时打折可以选择的商品类型
export const enum PRODUCT_TYPE {
  MEMBER_CARD = 1,
  DEPOSIT_CARD = 2,
  PERSONAL_COURSE = 3
}

// 小程序对应的商品类型枚举值
export const enum MINA_PRODUCT_TYPE {
  MEMBER_CARD = 5,
  DEPOSIT_CARD = 6,
  PERSONAL_COURSE = 9
}
